	add("menacer", "{\"term\":\"menacer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|menace|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who menaces\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1921\u0027\u0027, Edgar Rice Burroughs, \u0027Tarzan the Terrible\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Like a frightened deer Pan-at-lee cast a single startled look at these \u0027\u0027menacers\u0027\u0027 of her freedom and leaped quickly toward the bushes in an effort to escape\", \"priority\":3}]}, \"synonyms\":{}}");

