	add("menagerie", "{\"term\":\"menagerie\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027ménagerie\u0027 derived from \u0027ménager\u0027 (to keep house) \u0027ménage\u0027 Housekeeping used to include taking care of domestic animals.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A collection of live wild animals on exhibition; the enclosure where they are kept\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1949\u0027\u0027 - Bruce Kiskaddon, George R. Stewart Earth Abides\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In Sacramento a crazed woman opened the cages of a circus \u0027\u0027menagerie\u0027\u0027 for fear the animals might starve to death, and had been mauled by a lioness\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A diverse or miscellaneous group\", \"priority\":4}]}, \"synonyms\":{}}");

	add("menarche", "{\"term\":\"menarche\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\", \"English\", \"ancient greek (to 1453)\"], \"text\":\"First attested 1900, from German \u0027menarche\u0027 (1895), formed from \u0027meno-\u0027 (menstruation) + Ancient greek (to 1453) \u0027ἀρχή\u0027 (beginning)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The onset of menstruation; the beginning of the menstrual period. A girl\u0027s first period\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1973\u0027\u0027, Patrick O\u0027Brian, \u0027HMS Surprise\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"How old is she? Nine? Ten? The \u0027\u0027menarche\u0027\u0027 is not far off – a hint of a bosom, poor child\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1978\u0027\u0027, Benjamin Walker, \u0027Encyclopedia of Metaphysical Medicine\u0027, Routledge 1978, p. 252\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The most potent and indeed dangerous of all menstrual blood was the \u0027\u0027menarche\u0027\u0027, the first day\u0027s flow of the first menstruation of a virgin girl\", \"priority\":5}]}, \"synonyms\":{}}");

