	add("mendelevium", "{\"term\":\"mendelevium\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Named after the scientist w:Dmitri Mendeleev|Dmitri Mendeleev, who is the creator of the periodic table. The same name was proposed, but rejected, for the earlier-discovered elements berkelium and erbium.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A transuranic chemical element (\u0027symbol\u0027 Md, \u0027formerly\u0027 Mv) with atomic number 101\", \"priority\":1}]}, \"synonyms\":{}}");

