	add("menelaus", "{\"term\":\"menelaus\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin \u0027menelāus\u0027 from Ancient greek (to 1453) \u0027μενέλαος\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the king of Mycenaean Sparta, the husband of Helen of Troy, the brother of Agamemnon, the leader of the Spartan contingent of the Greek army during the Trojan War\", \"priority\":1}]}, \"synonyms\":{}}");

	add("menfolk", "{\"term\":\"menfolk\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|men|folk|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The male members of a group\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"At our family reunion, the \u0027\u0027menfolk\u0027\u0027 generally have a ball game, while the womenfolk gossip and trade snapshots\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Male people in general\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The old woman was surprised when the soldiers stopped to look at her camouflage quilts, since \u0027\u0027menfolk\u0027\u0027 are rarely interested in needlework\", \"priority\":4}]}, \"synonyms\":{}}");

	add("menhaden", "{\"term\":\"menhaden\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"narragansett\"], \"text\":\"From Narragansett \u0027munnawhatteaug|lang\u003dxnt\u0027 () influenced by \u0027poghaden\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of several species of fish in the genera and , used for fish meal, fish oil, fertilizer, and bait\", \"priority\":1}]}, \"synonyms\":{}}");

	add("menhir", "{\"term\":\"menhir\", \"etymology\":{\"influencers\":[], \"languages\":[\"Breton\", \"English\", \"French\"], \"text\":\"From French from Breton \u0027maen-hir\u0027 from \u0027maen\u0027 () + \u0027hir\u0027 () ( \u003d Welsh \u0027\u0027 Cornish \u0027\u0027 .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A single tall standing stone as a monument, especially of prehistoric times\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1963\u0027\u0027, Thomas Pynchon, \u0027V\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"no time has passed since we lived in caves, grappled with fish at the reedy shore, buried our dead with a song, with red-ochre and pulled up our dolmens, temples and \u0027\u0027menhirs\u0027\u0027 and standing stones to the glory of some indeterminate god or gods\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1980\u0027\u0027, Anthony Burgess, \u0027Earthly Powers\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"On the coast tree ferns and pandanus palms. Inland termite \u0027\u0027menhirs\u0027\u0027 seventeen feet high\", \"priority\":5}]}, \"synonyms\":{}}");

