	add("meninism", "{\"term\":\"meninism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|men|feminism|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A movement or philosophy, often presented satirically, in favour of the rights and interests of men\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027, Patrick Warren, \u0026quot;[http://issuu.com/uw_imprint/docs/1996-97_v19-n05_imprint Stick to bacon, Todd]\u0026quot; (letter to the editor), \u0027Imprint\u0027 (University of Waterloo), Volume 19, Number 5, 28 June 1996, page 9\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"As a man whose primary interests include neither beer nor bacon, I strongly object to the suggestion that these are issues which would define \u0026quot;the concepts and ideals of \u0027\u0027meninism\u0027\u0027.\u0026quot; Furthermore, the idea of \u0026quot;\u0027\u0027meninism\u0027\u0027\u0026quot; does not currently exist as a movement because men\u0027s issues are in no way underrepresented in mainstream culture\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2015\u0027\u0027, Jay Woofter, \u0026quot;[http://issuu.com/ecollegian/docs/1.29.15\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Meninists Twitter trend reacts to feminism]\u0026quot;, \u0027The Collegian\u0027 (Kansas State University), Volume 120, Number 82, 29 January 2015, page 3\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"One question to ask, however, is if \u0027\u0027meninism\u0027\u0027 could be taken seriously, or if it really is just an online joke\", \"priority\":6}]}, \"synonyms\":{}}");

	add("meninx", "{\"term\":\"meninx\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"Ancient greek (to 1453) \u0027μῆνιγξ|lang\u003dgrc\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a membrane, especially one of the three membranes enclosing the brain and spinal cord in vertebrates\", \"priority\":1}]}, \"synonyms\":{}}");

	add("meniscus", "{\"term\":\"meniscus\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027μηνίσκος\u0027 (crescent) from \u0027μήνη\u0027 (moon)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A crescent moon, or an object shaped like it\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1972\u0027\u0027, Vladimir Nabokov, \u0027Transparent Things\u0027, McGraw-Hill 1972, p. 19\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"He opened wide both casements; they gave on a parking place four floors below; the thin \u0027\u0027meniscus\u0027\u0027 overhead was too wan to illumine the roofs of the houses descending toward the invisible lake\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A lens which is convex on one side and concave on the other, being crescent-shaped in cross-section\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The curved surface of liquids in tubes, whether concave or convex, caused by the surface tension of the liquid\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Either of two parts of the human knee that provide structural integrity to the knee when it undergoes tension and torsion\", \"priority\":6}]}, \"synonyms\":{}}");

	add("menoetius", "{\"term\":\"menoetius\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"The name \u0026quot;Menoetius\u0026quot; literally means \u0026quot;defying fate\u0026quot; or \u0026quot;ruined strength\u0026quot;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A Titan, son of Iapetus and Clymene, he had three brothers- Atlas, Prometheus and Epimetheus. He joined Cronus and the Titans in their unsuccessful war against the Olympian gods. Zeus killed him with a thunderbolt and sent him down to Tartarus\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"One of Hades\u0027 shepherds on Erythea. He told Geryon when Heracles stole Geryon\u0027s herd\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Father of Patroclus and son of Actor. (Iliad, XI, 765\", \"priority\":3}]}, \"synonyms\":{}}");

	add("menorah", "{\"term\":\"menorah\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Hebrew\"], \"text\":\"From Hebrew \u0027מנורה\u0027 From the same Semitic root as \u0027minaret\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A holy candelabrum with seven branches used in the Temple of Jerusalem\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1985\u0027\u0027, w:Anthony Anthony Burgess, \u0027w:The Kingdom of the The Kingdom of the Wicked\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"‘Heathen muck,’ Liberalis said, as the pillaging began. The veil of the Temple was rent. The great \u0027\u0027menorah\u0027\u0027 was taken away\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A candelabrum with nine branches used in Jewish worship on Hanukkah\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1992\u0027\u0027, Merrill Joan Gerber, \u0027The Kingdom of Brooklyn\u0027, Syracuse University Press (2000), ISBN 0815606613, [http://books.google.com/books?id\u003dvSkePpzfSMcC\u0026amp;pg\u003dPA76 pages 76-77\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"My father brings home a big brass antique \u0027\u0027menorah\u0027\u0027, shaped like an archway, heavy, on a pedestal, on a round base\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027, Ann Kimmage, \u0027An Un-American Childhood\u0027, University of Georgia Press (1996), ISBN 9780820317687, [http://books.google.com/books?id\u003d6b9UDraIxesC\u0026amp;pg\u003dPA50 pages 49-50\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"In America every December my mother had decorated our home with metal Stars of David she hung on strings in the doorways and lit the \u0027\u0027menorah\u0027\u0027 as we gathered at the table\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Noam Zion \u0026amp; Barbara Spectre, \u0027A Different Light: The Hanukkah Book of Celebration\u0027, Devora Publishing (2000), ISBN 9781930143258, [http://books.google.com/books?id\u003dkv0LNPhBw8gC\u0026amp;pg\u003dPA239 page 237\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"However, traditional Sefardi families follow the halacha that each household uses only one \u0027\u0027menorah\u0027\u0027 lit by the head of the household, to represent everyone in unison\", \"priority\":10}]}, \"synonyms\":{}}");

