	add("mensk", "{\"term\":\"mensk\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"Danish\", \"German\", \"English\", \"Icelandic\", \"Dutch\", \"old norse\", \"Swedish\"], \"text\":\"From an early Scandinavian form (compare Old norse \u0027menskr\u0027 (human) , from Proto-germanic {{m|gem-pro|*manniskaz||human}}. Compare \u0027mannish\u0027 Cognate with Dutch \u0027mens\u0027 (human, humanity) German \u0027mensch\u0027 (man, human) Danish \u0027menneske\u0027 (human) Swedish \u0027människa\u0027 (human, human being, person) Icelandic \u0027manneskju\u0027 (person, human being) See also {{l|en|mense}}, {{l|en|mennish}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Dignity, honour\", \"priority\":1}]}, \"synonyms\":{}}");

	add("mensch", "{\"term\":\"mensch\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"German\", \"English\", \"old high german (ca. 750-1050)\", \"Yiddish\"], \"text\":\"From Yiddish \u0027מענטש\u0027 (an honorable person) from Old high german (ca. 750-1050) \u0027mennisko\u0027 (man) The spelling \u0027mensch\u0027 was influenced by German \u0027mensch\u0027 compare the alternative spellings.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person (chiefly male) of strength, integrity and honor or compassion\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Dwight S. Huggins, \u0027Into the Greenhouse Vol. VI: Dreams\u0027 (ISBN 1467050873\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"She was an Amerindian, and stout. She was a real \u0027\u0027mensch\u0027\u0027, a hard working person, who took pride in her job, which was to spray from an aerosol can a particular base\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A gentleman.Category:English nouns with irregular plurals\", \"priority\":4}]}, \"synonyms\":{}}");

	add("menses", "{\"term\":\"menses\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"Latin \u0027mensis\u0027 (month) the plural being \u0027menses\u0027 (months) corresponding to the monthly courses of women. Confer \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The discharge of blood mixed with pieces of cellular tissue from the uterus of a female out through her vagina, which occurs roughly every month; menstrual flow\", \"priority\":1}]}, \"synonyms\":{}}");

	add("menshevik", "{\"term\":\"menshevik\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Russian\"], \"text\":\"Borrowed from Russian \u0027меньшеви́к\u0027 derived from \u0027меньшинство́\u0027 (minority) formed in turn from Russian \u0027ме́ньше\u0027 the comparative of \u0027ма́лый\u0027 (little) lt;ref\u0026gt;T.F. Hoad, \u0027Concise Dictionary of English Etymology\u0027, ISBN 978-0-19-283098-2; headword \u0027Menshevik\u0027\u0026lt;/ref\u0026gt;.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A member of the gradualist or moderate wing of the Russian Social Democratic Workers\u0027 Party during the years preceding the Russian Revolution, when they split with the Bolsheviks; or a member of a later independent moderate-Marxist party formed in 1917\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1985\u0027\u0027, \u0027Illywhacker\u0027, Faber and Faber 2003, p. 259\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"‘Better an ultra-leftist than a \u0027\u0027Menshevik\u0027\u0027,’ said Rosa Kaletsky\", \"priority\":3}]}, \"synonyms\":{}}");

