	add("menstruation", "{\"term\":\"menstruation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|menstrual|ation|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The periodic discharging of the menses, the flow of blood and cells from the lining of the uterus in females of humans and other primates\", \"priority\":1}]}, \"synonyms\":{}}");

