	add("mensuration", "{\"term\":\"mensuration\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The branch of mathematics that deals with measurement, especially the derivation and use of algebraic formulae to measure the areas, volumes and different parameters of geometric figures\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"With the passage of time I have realized that the illustrations can also serve, to some extent, to make \u0027\u0027mensuration\u0027\u0027 more readily possible\", \"priority\":2}]}, \"synonyms\":{}}");

