	add("mentalité", "{\"term\":\"mentalité\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027mentalité\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person\u0027s feelings about the wider society and world in which they live, and their place within in; a worldview, outlook\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, \u0027The Great Nation\u0027, Penguin 2003, p. 67\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Yet changing a traditional economic \u0027\u0027\u0027mentalité\u0027\u0027\u0027 was an uphill task and, significantly, Law never fully disenchanted even his most intimate supporters (and maybe even himself) with customary forms of wealth\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, ‘What\u0027s Your Take?’, \u0027Literary Review\u0027 404\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"David Thomson\u0027s objectives in this big, ambitious book are nothing short of Promethean, for he aims to deliver both a comprehensive history of the movies and a Marshall McLuhan-style examination of the \u0027\u0027\u0027mentalités\u0027\u0027\u0027 produced by watching films and television. Category:English terms spelled with É\", \"priority\":5}]}, \"synonyms\":{}}");

	add("mentality", "{\"term\":\"mentality\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|mental|ity|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A mindset; a way of thinking\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Before he can succeed, he will have to shed the \u0027\u0027mentality\u0027\u0027 that he can get by without hard work\", \"priority\":2}]}, \"synonyms\":{}}");

