	add("mention", "{\"term\":\"mention\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027mention\u0027 from Latin {{m|la|mentiō}}, \u0027mentionis\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A speaking or notice of anything, usually in a brief or cursory manner. Used especially in the phrase to \u0027make mention of\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Bible, Psalms lxxi. 1\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I will make \u0027\u0027mention\u0027\u0027 of thy righteousness\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"And sleep in dull, cold marble, where no \u0027\u0027mention\u0027\u0027 / Of me more must be heard of\", \"priority\":5}]}, \"synonyms\":{}}");

	add("mentor", "{\"term\":\"mentor\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\", \"Latin\", \"Sanskrit\"], \"text\":\"From French \u0027mentor\u0027 from Ancient greek (to 1453) \u0027μέντωρ\u0027 (mentor) a mythological character in the w:Odyssey|Odyssey, whose name, a historical name from Ancient Greece, may share the same root as English min. English|mind.\u0026lt;ref\u0026gt;\u0026quot;mentor, n.\u0026quot;. OED Online. March 2013. Oxford University Press. 1 April 2013, http://www.oed.com/view/Entry/116575?rskey\u003dEAtx24\u0026amp;result\u003d1\u0026amp;isAdvanced\u003dfalse.\u0026lt;/ref\u0026gt; Akin to Sanskrit \u0027मन्तृ\u0027 (one who thinks) and Latin \u0027monitor\u0027 (one who admonishes) and perhaps ultimately from Proto-indo-european {{m|ine-pro|*mon-eyo-}}, causative form of {{m|ine-pro|*men-||to think}}.\u0026lt;ref\u0026gt;\u0026quot;mentor (n.)\u0026quot;. Online Etymology Dictionary. 2013. Douglas Harper. 2 September 2013, http://www.etymonline.com/index.php?term\u003dmentor.\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A wise and trusted counselor or teacher\", \"priority\":1}]}, \"synonyms\":{}}");

